window.bookSummaryJSON = "<p>Seth and Evan met \"on the job\" when Evan was the intended sacrifice of a dark coven, and Seth came to the rescue. Now, they've teamed up to stop a century of ritual murders and get justice for Seth's brother Jesse and the other victims.</p> <p>Seth and Evan have a plan to stop the next witch disciple, plus new allies and magic. But this time, the warlock knows they're coming, and he has plans of his own. When Seth disappears and is trapped in a spell that gives him his heart's desire, can he free himself in time to help Evan?</p> <p>And when Evan's younger brother shows up unexpectedly, can Evan trust Parker to have his back? It all comes down to trusting the devil you know!</p> <p>Contains mature themes.</p>"; 
